import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const Home = ({ books, counselors }) => {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState("");

  const filteredCounselors = counselors.filter((counselor) =>
    counselor.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <h2 className="brand-name">SMHS</h2>
        <ul className="nav-links">
          <li>
            <button onClick={() => navigate("/home")} className="nav-link">
              Home
            </button>
          </li>
          <li>
            <button
              onClick={() => navigate("/one-on-one-sessions")}
              className="nav-link"
            >
              One-on-One Sessions
            </button>
          </li>
          <li>
            <button
              onClick={() => navigate("/virtual-sessions")}
              className="nav-link"
            >
              Virtual Sessions
            </button>
          </li>
          <li>
            <button onClick={() => navigate("/chatbot")} className="nav-link">
              ChatBot
            </button>
          </li>
          <li>
            <button onClick={() => navigate("/login")} className="logout-button">
              Logout
            </button>
          </li>
        </ul>
      </nav>

      {/* Hero Section */}
      <header className="hero-section">
        <h1>Welcome to SMHS</h1>
        <p>Your one-stop solution for mental health resources and support</p>
      </header>

      {/* Books Section */}
      <section id="books" className="section">
        <h2>Recommended Books</h2>
        <div className="scrolling-books-container">
          <div className="scrolling-books">
            {books.map((book, index) => (
              <div className="book-card" key={index}>
                {book.image && <img src={book.image} alt={book.title} />}
                <p>{book.title}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Counselors Section */}
      <section id="counselors" className="section">
        <h2>Counselors</h2>
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search counselor by name..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>
        <div className="counselors-list">
          {filteredCounselors.map((counselor) => (
            <div className="counselor-card" key={counselor.id}>
              <h3>{counselor.name}</h3>
              <p>Specialized in: {counselor.specialization}</p>
              <p>Email: {counselor.email}</p>
            </div>
          ))}
          {filteredCounselors.length === 0 && (
            <p className="no-results">No counselors found.</p>
          )}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2024 SMHS. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
